import { NavLink } from "react-router-dom";
import "./Navbar.css";

export function Navbar(): JSX.Element {
    return (
        <div className="Navbar">
            <ul></ul>

            <NavLink to="/home">Home</NavLink>

            <NavLink end to="/countries">Countries</NavLink>

        </div>
    );
}
